import "./App.css";
import { useState, useEffect } from "react";
import axios from "axios";

function App() {
  const [movies, setMovies] = useState({});

  useEffect(() => {
    const movies = axios.get("/movies").then((response) => {
      console.log(response.data);
      setMovies(response.data);
    });
  }, []);

  return (
    <div className="App">
      <h1>{movies?.title}</h1>
    </div>
  );
}

export default App;
